        ////////////////////////////////////////////////////////////////
        // Prepare single model from provided pointers
        ////////////////////////////////////////////////////////////////
        bool prepareSingleModel
        (
            const uint8_t* pixels, const uint8_t* palette,
            int32_t image_width, int32_t image_height,
            int32_t v_count, const ePoint3* vertices, const ePoint2* uv,
            int32_t i_count, const ushort* indices,
            eGeoSet** model, eMaterial** material
        )
        {
            int32_t i;

            eGeoSet* test_geoset = nullptr;
            eMaterial* test_material = nullptr;
            eTexture* test_texture = nullptr;
            eBitmap* test_bitmap = nullptr;

            eGeoArray<ePoint4>* test_vertex_array = nullptr;
            eGeoArray<ePoint2>* test_uv_array = nullptr;
            eGeoArray<ushort>* test_indices_array = nullptr;
            eGeoArray<ePoint4>* test_colors_array = nullptr;

            ePoint4* test_vertex_data = nullptr;
            ePoint2* test_uv_data = nullptr;
            ushort* test_indices_data = nullptr;
            ePoint4* test_colors_data = nullptr;

            uint32_t new_palette[256];

            /********************************/
            /* Create objects (3D model) */

            (*model) = new eGeoSet;
            (*model)->incRef();

            test_vertex_data = new ePoint4 [v_count];

            for (i = 0; i < v_count; i++)
            {
                test_vertex_data[i].x = vertices[i].x;
                test_vertex_data[i].y = vertices[i].y;
                test_vertex_data[i].z = vertices[i].z;
                test_vertex_data[i].w = 1.0f;
            }

            test_uv_data = new ePoint2 [v_count];

            for (i = 0; i < v_count; i++)
            {
                test_uv_data[i] = uv[i];
            }

            test_indices_data = new ushort [i_count];

            for (i = 0; i < i_count; i++)
            {
                test_indices_data[i] = indices[i];
            }

            test_colors_data = new ePoint4 [v_count];

            for (i = 0; i < v_count; i++)
            {
                test_colors_data[i].x = 1.0f;
                test_colors_data[i].y = 1.0f;
                test_colors_data[i].z = 1.0f;
                test_colors_data[i].w = 1.0f;
            }

            test_vertex_array = new eGeoArray<ePoint4>;
            test_vertex_array->setup(v_count, test_vertex_data);
            (*model)->setVerticesArray(test_vertex_array);

            test_uv_array = new eGeoArray<ePoint2>;
            test_uv_array->setup(v_count, test_uv_data);
            (*model)->setTextureCoordsArray(test_uv_array);

            test_indices_array = new eGeoArray<ushort>;
            test_indices_array->setup(i_count, test_indices_data);
            (*model)->setIndicesArray(test_indices_array);

            test_colors_array = new eGeoArray<ePoint4>;
            test_colors_array->setup(v_count, test_colors_data);
            (*model)->setColorsArray(test_colors_array);

            (*model)->prepareForDrawing();

            /********************************/
            /* Create objects (texturing) */

            test_bitmap = new eBitmap;
            test_bitmap->incRef();

            for (i = 0; i < 256; i++)
            {
                new_palette[i] = (palette[4*i+2]) | (palette[4*i+1] << 8) | (palette[4*i+0] << 16) | (palette[4*i+3] << 24);
            }

            test_bitmap->loadRaw(pixels, new_palette, image_width, image_height);
            test_bitmap->generateTexture();

            test_texture = new eTexture(test_bitmap);
            test_texture->incRef();
            test_bitmap->decRef();

            (*material) = new eMaterial(test_texture);
            (*material)->incRef();
            test_texture->decRef();

            return true;
        }


        ////////////////////////////////////////////////////////////////
        // Prepare special models (help in 3D visualisation)
        ////////////////////////////////////////////////////////////////
        bool prepareSpecialModels()
        {
            int32_t i;

            for (i = 0; i < ZOOKIEWIZARD_SPECIALMODEL_COUNT; i++)
            {
                mySpecialModels[i] = nullptr;
            }

            /********************************/
            /* [0] ARROW */

            if (!prepareSingleModel
            (
                model_arrow_pixels, model_arrow_palette,
                64, 64,
                16, model_arrow_vertices, model_arrow_uv,
                63, model_arrow_indices,
                &(mySpecialModels[0]), &(mySpecialModelsMaterials[0])
            ))
            {
                return false;
            }

            /********************************/
            /* [1] KAO */

            if (!prepareSingleModel
            (
                model_kao_pixels, model_kao_palette,
                128, 256,
                4, model_kao_vertices, model_kao_uv,
                6, model_kao_indices,
                &(mySpecialModels[1]), &(mySpecialModelsMaterials[1])
            ))
            {
                return false;
            }

            /********************************/
            /* [2] CAMERA */

            if (!prepareSingleModel
            (
                model_camera_pixels, model_camera_palette,
                64, 64,
                280, model_camera_vertices, model_camera_uv,
                960, model_camera_indices,
                &(mySpecialModels[2]), &(mySpecialModelsMaterials[2])
            ))
            {
                return false;
            }

            return true;
        }


        ////////////////////////////////////////////////////////////////
        // Render special model
        ////////////////////////////////////////////////////////////////
        void renderSpecialModel(int32_t id)
        {
            eTexture* dummy_texture = nullptr;
            GLuint texture_name = 0;

            if ((id >= 0) && (id < ZOOKIEWIZARD_SPECIALMODEL_COUNT))
            {
                if (nullptr != mySpecialModels[id])
                {
                    if (nullptr != mySpecialModelsMaterials[id])
                    {
                        dummy_texture = mySpecialModelsMaterials[id]->getIthTexture(0);
                    }

                    if (nullptr != dummy_texture)
                    {
                        texture_name = dummy_texture->getTextureName();
                    }

                    mySpecialModels[id]->draw(0, texture_name, 0);
                }
            }
        }


        ////////////////////////////////////////////////////////////////
        // Destroy special models
        ////////////////////////////////////////////////////////////////
        void clearSpecialModels()
        {
            int32_t i;

            for (i = 0; i < ZOOKIEWIZARD_SPECIALMODEL_COUNT; i++)
            {
                if (nullptr != mySpecialModels[i])
                {
                    mySpecialModels[i]->decRef();
                    mySpecialModels[i] = nullptr;
                }

                if (nullptr != mySpecialModelsMaterials[i])
                {
                    mySpecialModelsMaterials[i]->decRef();
                    mySpecialModelsMaterials[i] = nullptr;
                }
            }
        }

